FILE_MISSING:"Houve um problema com esse conte\u00fado. Parece que voc\u00ea removeu o arquivo de v\u00eddeo associado a ele.",CODEC_PROBLEM:"Parece que houve um problema ao adicionar o arquivo de v\u00eddeo ao player. Isso aconteceu provavelmente por causa de um problema de codec. Tente converter o v\u00eddeo para um codec compat\u00edvel com HTML5, remova o arquivo de v\u00eddeo atual e re-adicione ele. Se os codecs est\u00e3o ok, cheque o log de erros do servidor e a URL base nas configura\u00e7\u00f5es.",
